from typing import List
import collections
class Solution:
	def minSumOfLengths(self, arr: List[int], target: int) -> int:
		import bisect
		dp = {0:0}
		cur = 0
		res = [float("inf")]
		ans =  float("inf")
		for idx, num in enumerate(arr, 1):
			cur += num
			# print(cur, dp)
			if cur - target in dp:


				# print(dp[cur-target], res[dp[cur-target]])
				ans = min(ans, idx - dp[cur - target] + res[dp[cur-target]])
				res.append(min(idx - dp[cur - target], res[-1]))

			else:
				res.append(res[-1])
			dp[cur] = idx
			# print(res)

		return ans

	
	
